import {backendLookup} from "../lookup"

export function apiProfileDetail(username, callback){
  backendLookup('GET', `/profiles/${username}/`, callback)   
}

export function apiProfileFollowingToggle(username, callback, action){
  const data = {action}
  backendLookup('POST', `/profiles/${username}/`, callback, data)   
}
